import React, { useState, useEffect, useCallback, useMemo } from 'react';
import { useToast } from '../ToastProvider';
import { calculateGeneKeys } from '../../services/api';
import * as Tabs from '@radix-ui/react-tabs';
import type { GeneKeysChartProps, GeneKeysData, GeneKey } from './types';
import type { ChartBirthData } from '@cosmichub/types';
import GeneKeyDetails from './GeneKeyDetails';
import CoreQuartetTab from './CoreQuartetTab';
import ActivationSequenceTab from './ActivationSequenceTab';
import VenusSequenceTab from './VenusSequenceTab';
import PearlSequenceTab from './PearlSequenceTab';
import HologenicProfileTab from './HologenicProfileTab';

const GeneKeysChart: React.FC<GeneKeysChartProps> = React.memo(({ birthData, onCalculate }) => {
  // Holds the calculated Gene Keys profile; stays null until a valid object is received.
  // (Tests previously caused an undefined value to be set which bypassed the strict null check
  // and led to runtime errors deeper in the tree. We defensively constrain to null | GeneKeysData.)
  const [geneKeysData, setGeneKeysData] = useState<GeneKeysData | null>(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [selectedKey, setSelectedKey] = useState<GeneKey | null>(null);
  const { toast } = useToast();

  const handleCalculate = useCallback(async () => {
    if (birthData === null || birthData === undefined) {
      return;
    }

    setLoading(true);
    setError(null);

    try {
      const response = await calculateGeneKeys(birthData);
      // Defensive: only accept a response that looks like a GeneKeysData object; otherwise keep null
  if (response !== null && response !== undefined && typeof response === 'object' && 'life_work' in response && 'evolution' in response) {
        setGeneKeysData(response);
      } else {
        // Treat an unexpected shape as an error to avoid propagating undefined into children
        throw new Error('Invalid Gene Keys response');
      }

      toast({
        title: "Gene Keys Calculated",
        description: "Your Gene Keys profile has been generated successfully!",
        status: "success",
        duration: 3000,
      });
    } catch (err) {
      const errorMessage = err instanceof Error ? err.message : 'Failed to calculate Gene Keys';
      setError(errorMessage);
      toast({
        title: "Calculation Error",
        description: errorMessage,
        status: "error",
        duration: 5000,
      });
    } finally {
      setLoading(false);
    }
  }, [birthData, toast]);

  const handleKeySelect = useCallback((key: GeneKey) => {
    setSelectedKey(key);
  }, []);

  // Memoized empty state button handler
  const handleEmptyCalculate = useCallback(() => {
    if (typeof onCalculate === 'function') {
      // Provide a deterministic sample request for quick demo
      void Promise.resolve(onCalculate({
        year: 2000,
        month: 1,
        day: 1,
        hour: 0,
        minute: 0
      } as ChartBirthData));
    }
  }, [onCalculate]);

  useEffect(() => {
    if (birthData !== null && birthData !== undefined) {
      void handleCalculate();
    }
    // Intentional: handleCalculate depends on toast causing changing identity; rely only on birthData changes
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [birthData]);

  // Memoized loading state
  const loadingState = useMemo(() => (
    <div className="py-10 text-center">
      <div className="mx-auto text-4xl text-purple-500 animate-spin"></div>
      <p className="mt-4 text-cosmic-silver">Calculating your Gene Keys profile...</p>
    </div>
  ), []);

  // Memoized error state
  const errorState = useMemo(() => (
    <div className="p-4 border border-red-500 rounded-md bg-red-900/50">
      {error}
    </div>
  ), [error]);

  // Memoized empty state
  const emptyState = useMemo(() => (
    <div className="py-10 text-center">
      <p className="mb-4 text-lg text-gray-700">
        Enter your birth information to calculate your Gene Keys profile
      </p>
  {(typeof onCalculate === 'function') && (
        <button className="cosmic-button" onClick={handleEmptyCalculate}>
          Calculate Gene Keys
        </button>
      )}
    </div>
  ), [onCalculate, handleEmptyCalculate]);

  if (loading === true) return loadingState;
  if (error !== null) return errorState;
  // Treat both null and undefined (should not happen now) as empty state
  if (geneKeysData === null) return emptyState;

  return (
    <div className="p-6">
      <Tabs.Root defaultValue="core">
                <Tabs.List className="flex flex-wrap mb-6 border-b border-cosmic-silver/30">
          <Tabs.Trigger value="core" className="px-4 py-2 data-[state=active]:bg-cosmic-purple/20 data-[state=active]:text-cosmic-purple hover:bg-cosmic-purple/10 transition-colors">
             Core Quartet
          </Tabs.Trigger>
          <Tabs.Trigger value="activation" className="px-4 py-2 data-[state=active]:bg-cosmic-purple/20 data-[state=active]:text-cosmic-purple hover:bg-cosmic-purple/10 transition-colors">
             Activation (IQ)
          </Tabs.Trigger>
          <Tabs.Trigger value="venus" className="px-4 py-2 data-[state=active]:bg-cosmic-purple/20 data-[state=active]:text-cosmic-purple hover:bg-cosmic-purple/10 transition-colors">
             Venus (EQ)
          </Tabs.Trigger>
          <Tabs.Trigger value="pearl" className="px-4 py-2 data-[state=active]:bg-cosmic-purple/20 data-[state=active]:text-cosmic-purple hover:bg-cosmic-purple/10 transition-colors">
             Pearl (SQ)
          </Tabs.Trigger>
          <Tabs.Trigger value="profile" className="px-4 py-2 data-[state=active]:bg-cosmic-purple/20 data-[state=active]:text-cosmic-purple hover:bg-cosmic-purple/10 transition-colors">
             Hologenetic Profile
          </Tabs.Trigger>
          {(selectedKey !== null) && (
            <Tabs.Trigger value="details" className="px-4 py-2 data-[state=active]:bg-cosmic-purple/20 data-[state=active]:text-cosmic-purple hover:bg-cosmic-purple/10 transition-colors">
               Gene Key {selectedKey.number}
            </Tabs.Trigger>
          )}
        </Tabs.List>

        <Tabs.Content value="core" className="p-6">
          <CoreQuartetTab 
            geneKeysData={geneKeysData} 
            onKeySelect={handleKeySelect} 
          />
        </Tabs.Content>

        <Tabs.Content value="activation" className="p-6">
          <ActivationSequenceTab 
            geneKeysData={geneKeysData} 
            onKeySelect={handleKeySelect} 
          />
        </Tabs.Content>

        <Tabs.Content value="venus" className="p-6">
          <VenusSequenceTab 
            geneKeysData={geneKeysData} 
            onKeySelect={handleKeySelect} 
          />
        </Tabs.Content>

        <Tabs.Content value="pearl" className="p-6">
          <PearlSequenceTab 
            geneKeysData={geneKeysData} 
            onKeySelect={handleKeySelect} 
          />
        </Tabs.Content>

        <Tabs.Content value="profile" className="p-6">
          <HologenicProfileTab geneKeysData={geneKeysData} />
        </Tabs.Content>

        <Tabs.Content value="details" className="p-6">
          <GeneKeyDetails selectedKey={selectedKey} />
        </Tabs.Content>
      </Tabs.Root>
    </div>
  );
});

GeneKeysChart.displayName = 'GeneKeysChart';

export default GeneKeysChart;

import { z } from 'zod';

// Environment validation schema
const envSchema = z.object({
  VITE_FIREBASE_API_KEY: z.string().min(1, 'Firebase API key is required'),
  VITE_FIREBASE_AUTH_DOMAIN: z.string().min(1, 'Firebase auth domain is required'),
  VITE_FIREBASE_PROJECT_ID: z.string().min(1, 'Firebase project ID is required'),
  VITE_FIREBASE_STORAGE_BUCKET: z.string().min(1, 'Firebase storage bucket is required'),
  VITE_FIREBASE_MESSAGING_SENDER_ID: z.string().min(1, 'Firebase messaging sender ID is required'),
  VITE_FIREBASE_APP_ID: z.string().min(1, 'Firebase app ID is required'),
  VITE_API_URL: z.string().url().optional(),
  VITE_XAI_API_KEY: z.string().optional(),
  NODE_ENV: z.enum(['development', 'production', 'test']).default('development'),
  VITE_ENABLE_ANALYTICS: z.string().transform(val => val === 'true').optional(),
  VITE_ENABLE_ERROR_REPORTING: z.string().transform(val => val === 'true').optional(),
});

// Validate environment variables
function validateEnvironment() {
  try {
    return envSchema.parse(import.meta.env);
  } catch (error) {
    // Use raw console.error here intentionally (bootstrapping prior to devConsole creation)
    // eslint-disable-next-line no-console
    console.error('Environment validation failed:', error);
    throw new Error('Invalid environment configuration');
  }
}

// Export validated environment
export const env = validateEnvironment();

// Environment helper functions
export const isDevelopment = () => env.NODE_ENV === 'development';
export const isProduction = () => env.NODE_ENV === 'production';
export const isTest = () => env.NODE_ENV === 'test';

// Feature flags
export const features = {
  analytics: env.VITE_ENABLE_ANALYTICS ?? false,
  errorReporting: env.VITE_ENABLE_ERROR_REPORTING ?? isProduction(),
  healwave: true,
  numerology: true,
  humanDesign: true,
  crossAppIntegration: true,
};

// API configuration
export const apiConfig = {
  baseUrl: env.VITE_API_URL ?? 'http://localhost:8001',
  timeout: 10000,
  retries: 3,
};

// Firebase configuration
export const firebaseConfig = {
  apiKey: env.VITE_FIREBASE_API_KEY,
  authDomain: env.VITE_FIREBASE_AUTH_DOMAIN,
  projectId: env.VITE_FIREBASE_PROJECT_ID,
  storageBucket: env.VITE_FIREBASE_STORAGE_BUCKET,
  messagingSenderId: env.VITE_FIREBASE_MESSAGING_SENDER_ID,
  appId: env.VITE_FIREBASE_APP_ID,
};

// Security configuration
export const securityConfig = {
  enableCSP: isProduction(),
  enableHSTS: isProduction(),
  sessionTimeout: 24 * 60 * 60 * 1000, // 24 hours
  maxLoginAttempts: 5,
  lockoutDuration: 15 * 60 * 1000, // 15 minutes
};

// XAI API configuration
export const xaiConfig = {
  apiKey: env.VITE_XAI_API_KEY,
  baseUrl: 'https://api.x.ai/v1',
  model: 'grok-beta',
  timeout: 30000,
  enabled: env.VITE_XAI_API_KEY !== null && env.VITE_XAI_API_KEY !== undefined && env.VITE_XAI_API_KEY !== '',
};

// Logging configuration
export const loggingConfig = {
  level: isDevelopment() ? 'debug' : 'warn',
  enableConsole: isDevelopment(),
  enableRemote: isProduction(),
};

// Performance monitoring configuration
export const performanceConfig = {
  enabled: isDevelopment() || env.VITE_ENABLE_ANALYTICS === true,
  trackingInterval: 5000, // 5 seconds
  maxOperations: 1000, // Keep last 1000 operations
  enableMemoryTracking: 'memory' in performance,
  enablePagePerformance: true,
  enableComponentTracking: isDevelopment(),
  thresholds: {
    slowOperation: 1000, // 1 second
    memoryWarning: 80, // 80% of heap limit
    renderWarning: 100, // 100ms render time
  },
  logging: {
    enabled: isDevelopment(),
    verbose: false,
    logSlowOperations: true,
  },
};

// Development utilities
// Dev logging abstraction (silences in production except errors)
// Wrapped in factory to support tree-shaking and easier future extension (e.g., remote logging)
/* eslint-disable no-console */
interface DevConsole {
  log: (...args: unknown[]) => void;
  warn: (...args: unknown[]) => void;
  info: (...args: unknown[]) => void;
  debug: (...args: unknown[]) => void;
  error: (...args: unknown[]) => void;
}

const noop = (): void => {};
const makeDevConsole = (): DevConsole => ({
  log: isDevelopment() ? console.log.bind(console) : noop,
  warn: isDevelopment() ? console.warn.bind(console) : noop,
  info: isDevelopment() ? (console.info?.bind(console) ?? noop) : noop,
  debug: isDevelopment() ? console.debug.bind(console) : noop,
  error: console.error.bind(console), // Always surface errors
});
/* eslint-enable no-console */

export const devConsole = makeDevConsole();

export default env;

/**
 * Example Integration: Using Push Notifications in CosmicHub Components
 * This shows how to integrate the notification system into your existing components
 */

import React, { useEffect, useState, type ReactElement } from 'react';
import { getNotificationManager } from '../services/notificationManager';
import { devConsole } from '../config/environment';
import type { NotificationPreferences } from '@cosmichub/config';
import type { ChartData } from '../types/notifications';

// Type definitions
interface BirthData {
  userId: string;
  birthDate?: string;
  birthTime?: string;
  birthLocation?: string;
  [key: string]: unknown;
}

interface NotificationStatus {
  pushNotifications?: {
    permissionStatus: string;
    activeSubscriptions?: number;
  };
  backgroundSync?: {
    isOnline: boolean;
    queuedItems?: number;
  };
}

type NotificationType = 'chart_synced' | 'user_data_synced';
interface NotificationItem {
  id: number;
  type: NotificationType;
  data: Record<string, unknown>;
  timestamp: number;
}

interface StorageMessage {
  type: 'cosmichub-sync-chart_synced' | 'cosmichub-sync-user_data_synced';
  data?: unknown;
  timestamp: number;
}

interface UserPreferences {
  dailyHoroscope: boolean;
  transitAlerts: boolean;
  frequencyReminders: boolean;
  appUpdates: boolean;
  quietHours: {
    enabled: boolean;
    start: string;
    end: string;
  };
  frequency: 'daily' | 'weekly' | 'monthly';
}

// (Removed MinimalChartData  using ChartData directly via guard)

// Type guard functions
function isValidChartData(data: unknown): data is ChartData {
  if (typeof data !== 'object' || data === null) return false;
  return 'id' in data && typeof (data as { id: unknown }).id === 'string';
}

// Example: Chart Calculation Component with Notifications
export const ChartCalculationWithNotifications: React.FC = () => {
  const [isCalculating, setIsCalculating] = useState<boolean>(false);
  const [notificationManager] = useState<ReturnType<typeof getNotificationManager>>((): ReturnType<typeof getNotificationManager> => getNotificationManager());

  const calculateChart = async (birthData: BirthData): Promise<ChartData | null> => {
    setIsCalculating(true);

    try {
      // Start calculation
      const calculationPromise = fetch('/api/charts/calculate', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(birthData)
      });

      // Queue for background sync in case of network issues
      // Optional background sync if API exists
      const maybeSync = (notificationManager as unknown as { syncChartCalculation?: (data: { userId: string; birthData: BirthData; timestamp: number })=>Promise<void> }).syncChartCalculation;
      if (typeof maybeSync === 'function') {
        await maybeSync({ userId: birthData.userId, birthData, timestamp: Date.now() });
      }

      const result = await calculationPromise;
      const chartData: unknown = await result.json();

      // Notify chart completion using the correct method
      if (isValidChartData(chartData)) {
        await notificationManager.notifyChartReady(chartData);
        setIsCalculating(false);
        return chartData;
      }
      setIsCalculating(false);
      return null;

    } catch (error) {
      setIsCalculating(false);

      // Error handling - notification manager doesn't support direct queue access
      // eslint-disable-next-line no-console
      console.error('Chart calculation failed:', error);

      throw error;
    }
  };

  const handleCalculateChart = (): void => {
    void calculateChart({ userId: 'user123' /* birth data */ });
  };

  return (
    <div className="chart-calculation">
      <button 
        onClick={handleCalculateChart}
        disabled={isCalculating}
        className="px-6 py-3 bg-purple-600 text-white rounded-lg disabled:opacity-50"
      >
        {isCalculating ? 'Calculating...' : 'Calculate Chart'}
      </button>
    </div>
  );
};

// Example: User Settings Page with Notification Preferences
export const UserSettingsWithNotifications: React.FC = () => {
  const [notificationManager] = useState<ReturnType<typeof getNotificationManager>>((): ReturnType<typeof getNotificationManager> => getNotificationManager());
  const [status, setStatus] = useState<NotificationStatus>({});

  useEffect((): (() => void) => {
    // Load notification status
  const loadStatus = (): void => {
  const raw = notificationManager.status() as unknown as { push?: Record<string, unknown>; background?: Record<string, unknown> };
      const push = raw.push ?? {};
      const background = raw.background ?? {};
      const permissionStatus = typeof push.permissionStatus === 'string' ? push.permissionStatus : undefined;
  const pushNotifications = (permissionStatus !== undefined && permissionStatus !== '') ? {
        permissionStatus,
        activeSubscriptions: typeof push.activeSubscriptions === 'number' ? push.activeSubscriptions : undefined
      } : undefined;
      const isOnline = typeof background.isOnline === 'boolean' ? background.isOnline : undefined;
  const backgroundSync = (isOnline !== undefined) ? {
        isOnline,
        queuedItems: typeof background.queuedItems === 'number' ? background.queuedItems : undefined
      } : undefined;
      setStatus({ pushNotifications, backgroundSync });
    };

    loadStatus();

    // Update status every 10 seconds
  const interval = setInterval((): void => { loadStatus(); }, 10000);
  return () => { clearInterval(interval); };
  }, [notificationManager]);

  const handleSubscribe = async (): Promise<void> => {
  const success = await notificationManager.subscribe('user123', {
      dailyHoroscope: true,
      transitAlerts: true,
      frequencyReminders: false,
      appUpdates: true,
      quietHours: { enabled: true, start: '22:00', end: '08:00' },
      frequency: 'daily' as const
  } satisfies NotificationPreferences);

    if (success === true) {
      // Send welcome notification
      await notificationManager.sendTest();
    }
  };

  return (
    <div className="user-settings">
      <div className="notification-status mb-6">
        <h3 className="text-lg font-semibold mb-4">Notification Status</h3>

        <div className="grid grid-cols-2 gap-4">
          <div className="p-4 bg-gray-100 rounded">
            <div className="text-2xl font-bold text-blue-600">
              {status.pushNotifications?.permissionStatus === 'granted' ? '' : ''}
            </div>
            <div className="text-sm">Push Permission</div>
          </div>

          <div className="p-4 bg-gray-100 rounded">
            <div className="text-2xl font-bold text-green-600">
              {status.backgroundSync?.isOnline === true ? '' : ''}
            </div>
            <div className="text-sm">Connection Status</div>
          </div>

          <div className="p-4 bg-gray-100 rounded">
            <div className="text-2xl font-bold text-yellow-600">
              {status.backgroundSync?.queuedItems ?? 0}
            </div>
            <div className="text-sm">Queued Items</div>
          </div>

          <div className="p-4 bg-gray-100 rounded">
            <div className="text-2xl font-bold text-purple-600">
              {status.pushNotifications?.activeSubscriptions ?? 0}
            </div>
            <div className="text-sm">Active Devices</div>
          </div>
        </div>
      </div>

      <div className="notification-actions">
        <button
          onClick={(): void => { void handleSubscribe(); }}
          className="px-4 py-2 bg-green-600 text-white rounded mr-4"
        >
          Enable Notifications
        </button>

        <button
          onClick={(): void => { void notificationManager.sendTest(); }}
          className="px-4 py-2 bg-blue-600 text-white rounded mr-4"
        >
          Test Notification
        </button>

        <button
          onClick={(): void => { 
            // getSmartSuggestions method not available in current implementation
            // eslint-disable-next-line no-console
            console.log('Smart setup not yet implemented');
          }}
          className="px-4 py-2 bg-purple-600 text-white rounded"
        >
          Smart Setup
        </button>
      </div>
    </div>
  );
};

// Example: Dashboard with Real-time Notifications
export const DashboardWithNotifications: React.FC = () => {
  const [notifications, setNotifications] = useState<NotificationItem[]>([]);

  useEffect((): (() => void) => {
    // Listen for background sync events
  const handleStorageChange = (event: StorageEvent): void => {
      if (typeof event.key === 'string' && event.key.startsWith('cosmichub-sync-') && typeof event.newValue === 'string' && event.newValue.length > 0) {
        try {
          const parsed: unknown = JSON.parse(event.newValue);
          if (parsed === null || typeof parsed !== 'object') return;
          const maybe = parsed as { type?: unknown; timestamp?: unknown; data?: unknown };
          if (maybe.type === 'cosmichub-sync-chart_synced' || maybe.type === 'cosmichub-sync-user_data_synced') {
            if (typeof maybe.timestamp !== 'number') return;
            const msg: StorageMessage = { type: maybe.type, timestamp: maybe.timestamp, data: maybe.data };
            setNotifications((prev: NotificationItem[]): NotificationItem[] => [{
              id: Date.now(),
              type: msg.type === 'cosmichub-sync-chart_synced' ? 'chart_synced' : 'user_data_synced',
              data: (msg.data !== undefined && msg.data !== null && typeof msg.data === 'object') ? (msg.data as Record<string, unknown>) : {},
              timestamp: msg.timestamp
            }, ...prev.slice(0, 9)]);
          }
        } catch (error) {
          devConsole.warn?.('Failed to parse sync message:', error);
        }
      }
    };

    window.addEventListener('storage', handleStorageChange);

    // Simulate some notifications for demo
    const demoNotifications: NotificationItem[] = [
      {
        id: 1,
        type: 'chart_synced',
        data: { chartId: 'chart123' },
        timestamp: Date.now() - 300000 // 5 minutes ago
      },
      {
        id: 2,
        type: 'user_data_synced',
        data: { userId: 'user123' },
        timestamp: Date.now() - 600000 // 10 minutes ago
      }
    ];

    setNotifications(demoNotifications);

  return () => { window.removeEventListener('storage', handleStorageChange); };
  }, []);

  const triggerTransitAlert = (): void => {
    devConsole.debug?.('Transit alert demo');
  };

  const triggerDailyHoroscope = (): void => {
    devConsole.debug?.('Daily horoscope demo');
  };

  return (
    <div className="dashboard">
      <div className="notification-feed mb-6">
        <h3 className="text-lg font-semibold mb-4">Recent Activity</h3>
        <div className="space-y-2">
          {notifications.map((notification: NotificationItem): ReactElement => (
            <div 
              key={notification.id}
              className="p-3 bg-blue-50 border-l-4 border-blue-400 rounded"
            >
              <div className="flex justify-between items-start">
                <div>
                  <div className="font-medium">
                    {notification.type === 'chart_synced' && ' Chart Synchronized'}
                    {notification.type === 'user_data_synced' && ' Profile Updated'}
                  </div>
                  <div className="text-sm text-gray-600">
                    {new Date(notification.timestamp).toLocaleTimeString()}
                  </div>
                </div>
                <div className="text-xs text-blue-600">
                   Synced
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>

  <div className="demo-triggers">
        <h3 className="text-lg font-semibold mb-4">Demo Notifications</h3>

        <div className="space-x-4">
          <button
            onClick={(): void => { void triggerTransitAlert(); }}
            className="px-4 py-2 bg-red-600 text-white rounded"
          >
             Transit Alert
          </button>

          <button
            onClick={(): void => { void triggerDailyHoroscope(); }}
            className="px-4 py-2 bg-yellow-600 text-white rounded"
          >
             Daily Horoscope
          </button>

          <button
            onClick={(): void => { 
              // notifyRetrograde method not available in current implementation
              devConsole.debug?.('Retrograde alert demo: Mercury entering retrograde');
            }}
            className="px-4 py-2 bg-purple-600 text-white rounded"
          >
             Retrograde Alert
          </button>
        </div>
      </div>
    </div>
  );
};

// Example: Hook for using notifications in any component
interface UseNotificationsReturn {
  manager: ReturnType<typeof getNotificationManager>;
  status: NotificationStatus;
  isOnline: boolean;
  hasPermission: boolean;
  queuedItems: number;
  subscribe: (userId: string, preferences?: UserPreferences) => Promise<boolean>;
  unsubscribe: () => Promise<boolean>;
  sendTest: () => Promise<boolean>;
  notifyChart: (chartData: unknown) => Promise<void>;
  syncChart: () => Promise<void>;
}

export const useNotifications = (): UseNotificationsReturn => {
  const [manager] = useState<ReturnType<typeof getNotificationManager>>((): ReturnType<typeof getNotificationManager> => getNotificationManager());
  const [status, setStatus] = useState<NotificationStatus>({});

  useEffect((): (() => void) => {
  const updateStatus = (): void => {
  const raw = manager.status() as unknown as { push?: Record<string, unknown>; background?: Record<string, unknown> };
      const push = raw.push ?? {};
      const background = raw.background ?? {};
      const permVal = typeof push.permissionStatus === 'string' ? push.permissionStatus : undefined;
  const pushNotifications = (permVal !== undefined && permVal !== '') ? {
        permissionStatus: permVal,
        activeSubscriptions: typeof push.activeSubscriptions === 'number' ? push.activeSubscriptions : undefined
      } : undefined;
      const onlineVal = typeof background.isOnline === 'boolean' ? background.isOnline : undefined;
  const backgroundSync = (onlineVal !== undefined) ? {
        isOnline: onlineVal,
        queuedItems: typeof background.queuedItems === 'number' ? background.queuedItems : undefined
      } : undefined;
      setStatus({ pushNotifications, backgroundSync });
    };

    updateStatus();
  const interval = setInterval((): void => { updateStatus(); }, 5000);

  return () => { clearInterval(interval); };
  }, [manager]);

  return {
  manager,
  status,
  isOnline: (status.backgroundSync?.isOnline === true),
  hasPermission: (status.pushNotifications?.permissionStatus === 'granted'),
  queuedItems: status.backgroundSync?.queuedItems ?? 0,

    // Helper methods
  subscribe: (userId: string, preferences?: UserPreferences): Promise<boolean> => manager.subscribe(userId, preferences),

  unsubscribe: (): Promise<boolean> => Promise.resolve(true),

