import React, { useState, useCallback, useEffect } from 'react';
/* eslint-disable no-console */
const devConsole = {
  log: import.meta.env.DEV ? console.log.bind(console) : undefined,
  warn: import.meta.env.DEV ? console.warn.bind(console) : undefined,
  error: console.error.bind(console)
};
/* eslint-enable no-console */
import { Card, Button } from '@cosmichub/ui';
import { useToast } from './ToastProvider';
import { useAuth } from '@cosmichub/auth';
import { db } from '@cosmichub/config/firebase';
import { doc, setDoc, getDoc } from 'firebase/firestore';

interface ChartPreferencesData {
  theme: 'light' | 'dark' | 'auto';
  notifications: boolean;
  sessionReminders: boolean;
  audioQuality: 'standard' | 'high' | 'lossless';
}

const ChartPreferences: React.FC = React.memo(() => {
  const { toast } = useToast();
  const { user } = useAuth();
  const [preferences, setPreferences] = useState<ChartPreferencesData>({
    theme: 'dark',
    notifications: true,
    sessionReminders: true,
    audioQuality: 'high',
  });
  const [isLoading, setIsLoading] = useState(false);
  const [isLoadingPreferences, setIsLoadingPreferences] = useState(true);

  // Load user preferences on mount
  useEffect(() => {
    if (user?.uid) {
      loadUserPreferences();
    } else {
      setIsLoadingPreferences(false);
    }
  }, [user?.uid]);

  const loadUserPreferences = useCallback(async () => {
    if (!user?.uid) return;

    try {
      setIsLoadingPreferences(true);
      const userDocRef = doc(db, 'users', user.uid);
      const userDoc = await getDoc(userDocRef);

      if (userDoc.exists()) {
        const userData = userDoc.data();
        if (userData.healwavePreferences) {
          setPreferences(prev => ({
            ...prev,
            ...userData.healwavePreferences
          }));
        }
      }
    } catch (error) {
      // eslint-disable-next-line no-console
  devConsole.error('Failed to load user preferences:', error);
      toast({
        message: 'Failed to load your preferences',
        type: 'error'
      });
    } finally {
      setIsLoadingPreferences(false);
    }
  }, [user?.uid, toast]);

  const handlePreferenceChange = useCallback((key: keyof ChartPreferencesData, value: any) => {
    setPreferences(prev => ({
      ...prev,
      [key]: value
    }));
  }, []);

  const handleSavePreferences = useCallback(async () => {
    if (!user?.uid) {
      toast({
        message: 'You must be logged in to save preferences',
        type: 'error'
      });
      return;
    }

    try {
      setIsLoading(true);

      // Save preferences to Firestore
      const userDocRef = doc(db, 'users', user.uid);
      await setDoc(userDocRef, {
        healwavePreferences: preferences,
        updatedAt: new Date()
      }, { merge: true });

      toast({
        message: 'Preferences saved successfully',
        type: 'success'
      });
    } catch (error) {
      // eslint-disable-next-line no-console
  devConsole.error('Failed to save preferences:', error);
      toast({
        message: 'Failed to save preferences',
        type: 'error'
      });
    } finally {
      setIsLoading(false);
    }
  }, [user?.uid, preferences, toast]);

  return (
    <div className="space-y-6">
      <Card title="HealWave Preferences">
        <div className="space-y-4">
          <div>
            <label htmlFor="theme" className="block text-cosmic-silver mb-2">
              Theme
            </label>
            <select
              id="theme"
              value={preferences.theme}
              onChange={(e) => handlePreferenceChange('theme', e.target.value)}
              className="w-full p-2 rounded bg-cosmic-dark border border-cosmic-purple text-cosmic-silver"
              aria-label="Select theme"
            >
              <option value="dark">Dark</option>
              <option value="light">Light</option>
              <option value="auto">Auto</option>
            </select>
          </div>

          <div>
            <label htmlFor="audioQuality" className="block text-cosmic-silver mb-2">
              Audio Quality
            </label>
            <select
              id="audioQuality"
              value={preferences.audioQuality}
              onChange={(e) => handlePreferenceChange('audioQuality', e.target.value)}
              className="w-full p-2 rounded bg-cosmic-dark border border-cosmic-purple text-cosmic-silver"
              aria-label="Select audio quality"
            >
              <option value="standard">Standard (128kbps)</option>
              <option value="high">High (256kbps)</option>
              <option value="lossless">Lossless (FLAC)</option>
            </select>
          </div>

          <div className="flex items-center space-x-2">
            <input
              type="checkbox"
              id="notifications"
              checked={preferences.notifications}
              onChange={(e) => handlePreferenceChange('notifications', e.target.checked)}
              className="rounded"
            />
            <label htmlFor="notifications" className="text-cosmic-silver">
              Email notifications
            </label>
          </div>

          <div className="flex items-center space-x-2">
            <input
              type="checkbox"
              id="sessionReminders"
              checked={preferences.sessionReminders}
              onChange={(e) => handlePreferenceChange('sessionReminders', e.target.checked)}
              className="rounded"
            />
            <label htmlFor="sessionReminders" className="text-cosmic-silver">
              Session reminders
            </label>
          </div>
        </div>
      </Card>

      <div className="text-center">
        <Button 
          onClick={handleSavePreferences} 
          variant="primary"
          disabled={isLoading || isLoadingPreferences || !user}
        >
          {isLoading ? 'Saving...' : 'Save Preferences'}
        </Button>
        {isLoadingPreferences && (
          <p className="mt-2 text-sm text-cosmic-silver/70">Loading your preferences...</p>
        )}
        {!user && (
          <p className="mt-2 text-sm text-cosmic-silver/70">Sign in to save preferences</p>
        )}
      </div>
    </div>
  );
});

ChartPreferences.displayName = 'ChartPreferences';

export default ChartPreferences;

import React, { useState, useEffect, useCallback, memo } from 'react';

interface DurationTimerProps {
  duration: number; // in minutes
  isActive: boolean;
  onComplete?: () => void;
  onTimeUpdate?: (timeRemaining: number) => void;
}

const DurationTimer: React.FC<DurationTimerProps> = memo(({
  duration,
  isActive,
  onComplete,
  onTimeUpdate
}) => {
  const [timeRemaining, setTimeRemaining] = useState(duration * 60); // Convert to seconds
  const [isRunning, setIsRunning] = useState(false);

  // Memoized time formatter
  const formatTime = useCallback((seconds: number) => {
    const mins = Math.floor(seconds / 60);
    const secs = seconds % 60;
    return `${mins.toString().padStart(2, '0')}:${secs.toString().padStart(2, '0')}`;
  }, []);

  // Memoized progress calculation
  const getProgressPercentage = useCallback(() => {
    const totalSeconds = duration * 60;
    return totalSeconds > 0 ? ((totalSeconds - timeRemaining) / totalSeconds) * 100 : 0;
  }, [duration, timeRemaining]);

  // Reset timer when duration changes
  useEffect(() => {
    setTimeRemaining(duration * 60);
  }, [duration]);

  // Update running state when isActive changes
  useEffect(() => {
    setIsRunning(isActive);
  }, [isActive]);

  // Timer logic with cleanup
  useEffect(() => {
    let interval: NodeJS.Timeout | null = null;

    if (isRunning && timeRemaining > 0) {
      interval = setInterval(() => {
        setTimeRemaining((time) => {
          const newTime = time - 1;
          onTimeUpdate?.(newTime);

          if (newTime <= 0) {
            setIsRunning(false);
            onComplete?.();
            return 0;
          }

          return newTime;
        });
      }, 1000);
    }

    return () => {
      if (interval) clearInterval(interval);
    };
  }, [isRunning, timeRemaining, onComplete, onTimeUpdate]);

  // Accessibility and visual enhancements
  const progressPercentage = getProgressPercentage();
  const isCompleted = timeRemaining === 0;
  const statusText = isRunning 
    ? ' Session Active' 
    : isCompleted 
    ? ' Complete' 
    : ' Paused';

  return (
    <div className="space-y-4" role="timer" aria-label="Session timer">
      <div className="text-center">
        <div 
          className="text-3xl font-mono font-bold text-white mb-2"
          aria-live="polite"
          aria-label={`Time remaining: ${formatTime(timeRemaining)}`}
        >
          {formatTime(timeRemaining)}
        </div>
        <div className="text-sm text-white/70">
          {duration} minute session
        </div>
      </div>

      <div className="flex justify-center">
        <div className="relative w-24 h-24">
          <svg 
            className="w-24 h-24 transform -rotate-90" 
            viewBox="0 0 100 100"
            aria-hidden="true"
          >
            <circle
              cx="50"
              cy="50"
              r="45"
              stroke="rgba(255,255,255,0.1)"
              strokeWidth="8"
              fill="none"
            />
            <circle
              cx="50"
              cy="50"
              r="45"
              stroke="url(#gradient)"
              strokeWidth="8"
              fill="none"
              strokeLinecap="round"
              strokeDasharray={`${2 * Math.PI * 45}`}
              strokeDashoffset={`${2 * Math.PI * 45 * (1 - progressPercentage / 100)}`}
              className={`transition-all duration-1000 ease-linear ${
                isRunning ? 'animate-pulse' : ''
              }`}
            />
            <defs>
              <linearGradient id="gradient" x1="0%" y1="0%" x2="100%" y2="0%">
                <stop offset="0%" stopColor="#06b6d4" />
                <stop offset="50%" stopColor="#8b5cf6" />
                <stop offset="100%" stopColor="#ec4899" />
              </linearGradient>
            </defs>
          </svg>

          <div className="absolute inset-0 flex items-center justify-center">
            <div className="text-center">
              <div className="text-lg font-bold text-white drop-shadow-lg">
                {Math.round(progressPercentage)}%
              </div>
            </div>
          </div>
        </div>
      </div>

      <div className="flex justify-center">
        <div 
          className={`px-4 py-2 rounded-full text-sm font-medium transition-all duration-300 ${
            isRunning 
              ? 'bg-green-500/20 text-green-300 border border-green-400/50 shadow-lg shadow-green-500/20' 
              : isCompleted
              ? 'bg-blue-500/20 text-blue-300 border border-blue-400/50 shadow-lg shadow-blue-500/20'
              : 'bg-gray-500/20 text-gray-300 border border-gray-400/50'
          }`}
          role="status"
          aria-live="polite"
        >
          {statusText}
        </div>
      </div>

      <div className="w-full bg-white/10 rounded-full h-2 overflow-hidden">
        <div 
          className={`h-full bg-gradient-to-r from-cyan-400 via-purple-500 to-pink-500 transition-all duration-1000 ease-linear ${
            isRunning ? 'animate-pulse' : ''
          }`}
          style={{ width: `${progressPercentage}%` }}
          role="progressbar"
          aria-valuenow={progressPercentage}
          aria-valuemin={0}
          aria-valuemax={100}
          aria-label={`Session progress: ${Math.round(progressPercentage)}% complete`}
        />
      </div>

      {isRunning && (
        <div className="text-center text-xs text-white/60">
          <p>Time elapsed: {formatTime((duration * 60) - timeRemaining)}</p>
        </div>
      )}
    </div>
  );
});

DurationTimer.displayName = 'DurationTimer';

export default DurationTimer;

import React, { Component } from 'react';
import type { ErrorInfo, ReactNode } from 'react';
import { isDevelopment, devConsole } from '../config/environment';

/**
 * HealWave-specific error boundary with custom theming
 * Falls back to shared ErrorBoundary from @cosmichub/ui for most functionality
 */
interface HealWaveErrorBoundaryProps {
  children: ReactNode;
  fallback?: ReactNode;
  onError?: (error: Error, errorInfo: ErrorInfo) => void;
}

interface State {
  hasError: boolean;
  error: Error | null;
  errorInfo: ErrorInfo | null;
}

export class HealWaveErrorBoundary extends Component<HealWaveErrorBoundaryProps, State> {
  constructor(props: HealWaveErrorBoundaryProps) {
    super(props);
    this.state = {
      hasError: false,
      error: null,
      errorInfo: null,
    };
  }

  static getDerivedStateFromError(error: Error): Partial<State> {
    return {
      hasError: true,
      error,
    };
  }

  componentDidCatch(error: Error, errorInfo: ErrorInfo): void {
    this.setState({
      error,
      errorInfo,
    });

    // HealWave-specific logging
    if (isDevelopment()) {
      devConsole.log(' HealWave Error Boundary');
      devConsole.error('Error:', error);
      devConsole.error('Error Info:', errorInfo);
    }

    // Call custom error handler if provided
    this.props.onError?.(error, errorInfo);
  }

  private handleRetry = (): void => {
    this.setState({
      hasError: false,
      error: null,
      errorInfo: null,
    });
  };

  render(): ReactNode {
    if (this.state.hasError) {
      if (this.props.fallback) {
        return this.props.fallback;
      }

      return (
        <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-black via-purple-900/20 to-cyan-900/20">
          <div className="max-w-md w-full bg-black/50 backdrop-blur-md shadow-2xl rounded-lg p-8 border border-white/10">
            <div className="text-center">
              <div className="mx-auto flex items-center justify-center h-16 w-16 rounded-full bg-gradient-to-r from-cyan-500/20 to-purple-500/20 mb-6">
                <svg
                  className="h-8 w-8 text-cyan-400"
                  fill="none"
                  viewBox="0 0 24 24"
                  stroke="currentColor"
                  aria-hidden="true"
                >
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={1.5}
                    d="M9.813 15.904L9 18.75l-.813-2.846a4.5 4.5 0 00-3.09-3.09L2.25 12l2.846-.813a4.5 4.5 0 003.09-3.09L9 5.25l.813 2.846a4.5 4.5 0 003.09 3.09L15.75 12l-2.846.813a4.5 4.5 0 00-3.09 3.09z"
                  />
                </svg>
              </div>

              <h2 className="text-xl font-semibold text-white mb-3">
                Something went wrong
              </h2>

              <p className="text-gray-300 text-sm mb-6">
                The healing frequency was interrupted. Let's restore harmony to your experience.
              </p>

              {isDevelopment() && this.state.error && (
                <details className="mb-6 text-left">
                  <summary className="cursor-pointer text-sm font-medium text-gray-400 hover:text-gray-300">
                    Technical Details
                  </summary>
                  <div className="mt-2 p-3 bg-black/30 rounded border border-white/10 text-xs font-mono text-red-400 overflow-auto max-h-40">
                    <div className="font-semibold text-red-300">Error: {this.state.error.message}</div>
                    <pre className="mt-2 whitespace-pre-wrap">
                      {this.state.error.stack}
                    </pre>
                    {this.state.errorInfo && (
                      <pre className="mt-2 whitespace-pre-wrap text-blue-400">
                        {this.state.errorInfo.componentStack}
                      </pre>
                    )}
                  </div>
                </details>
              )}

              <div className="flex flex-col sm:flex-row gap-3">
                <button
                  type="button"
                  onClick={this.handleRetry}
                  className="inline-flex justify-center w-full sm:w-auto px-6 py-3 border border-transparent text-sm font-medium rounded-md text-white bg-gradient-to-r from-cyan-600 to-purple-600 hover:from-cyan-700 hover:to-purple-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-cyan-500 transition-all duration-200"
                >
                   Restore Harmony
                </button>
                <button
                  type="button"
                  onClick={() => window.location.reload()}
                  className="inline-flex justify-center w-full sm:w-auto px-6 py-3 border border-white/20 text-sm font-medium rounded-md text-gray-300 bg-white/5 hover:bg-white/10 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-white/25 transition-all duration-200"
                >
                   Reload App
                </button>
              </div>
            </div>
          </div>
        </div>
      );
    }

    return this.props.children;
  }
}

export default HealWaveErrorBoundary;

