export function createComponentTestSuite<T extends Record<string, any> = Record<string, any>>(suite: ComponentTestSuite<T>) {
  describe(suite.name, () => {
    let performanceAnalyzer: MockComponentPerformanceAnalyzer;

    beforeEach(() => {
