export class XAIService {
  private static baseUrl = 'https://api.x.ai/v1';

  private static getApiKey(): string {
    // Try to get from environment variables
    if (typeof process !== 'undefined' && process.env?.XAI_API_KEY) {
      return process.env.XAI_API_KEY;
    }

    // Try to get from Vite env
    if (typeof import.meta !== 'undefined' && (import.meta as any).env?.VITE_XAI_API_KEY) {
      return (import.meta as any).env.VITE_XAI_API_KEY;
    }

    throw new Error('XAI_API_KEY environment variable is not set');
  }

  static async generateInterpretation(
    request: InterpretationRequest
  ): Promise<string> {
    // Validate request
    try {
      InterpretationRequestSchema.parse(request);
    } catch (error) {
      throw new Error(`Invalid request data: ${error instanceof Error ? error.message : 'Unknown validation error'}`);
    }

    try {
      const apiKey = this.getApiKey();
      const prompt = this.buildPrompt(request);

      const response = await fetch(`${this.baseUrl}/chat/completions`, {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${apiKey}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          model: 'grok-beta',
          messages: [
            {
              role: 'system',
              content: 'You are an expert astrological interpreter with deep knowledge of cosmic influences, planetary alignments, and their impact on human personality and life path. Provide detailed, insightful, and personalized astrological interpretations based on birth data.'
            },
            {
              role: 'user',
              content: prompt
            }
          ],
          max_tokens: 500,
          temperature: 0.7,
        }),
      });

      if (!response.ok) {
        const errorData = await response.json().catch(() => ({}));
        throw new Error(`xAI API request failed: ${response.statusText} (${response.status})`);
      }

      const data = await response.json();

      // Extract the interpretation from the response
      const interpretation = data.choices?.[0]?.message?.content;
      if (!interpretation) {
        throw new Error('No interpretation received from xAI API');
      }

      return interpretation;
    } catch (error) {
      if (error instanceof Error) {
        throw new Error(`xAI API error: ${error.message}`);
      }
      throw new Error('Failed to fetch interpretation from xAI API');
    }
  }

  private static buildPrompt(request: InterpretationRequest): string {
