// Type-safe serialization utility for astrology data
import { z } from 'zod';
import type { AstrologyChart, UserProfile, NumerologyData } from './astrology.types.js';
import { 
  isAstrologyChart, 
  isUserProfile, 
  isNumerologyData,
  getAstrologyDataType
} from './type-guards.js';

// Define Zod schemas for validation
const ChartSchema = z.object({
  planets: z.array(z.object({
    name: z.string(),
    sign: z.string(),
    degree: z.number(),
    position: z.number(),
    house: z.string(),
    retrograde: z.boolean().optional(),
    // Use structured aspect schema instead of z.any
    aspects: z.array(z.object({
      planet1: z.string(),
      planet2: z.string(),
      type: z.string(),
      orb: z.number(),
      applying: z.string()
    })).optional()
  })),
  houses: z.array(z.object({
    house: z.number(),
    number: z.number(),
    sign: z.string(),
    degree: z.number(),
    cusp: z.number(),
    ruler: z.string()
  })),
  aspects: z.array(z.object({
    planet1: z.string(),
    planet2: z.string(),
    type: z.string(),
    orb: z.number(),
    applying: z.string()
  })),
  asteroids: z.array(z.object({
    name: z.string(),
    sign: z.string(),
    degree: z.number(),
    house: z.string()
  })),
  angles: z.array(z.object({
    name: z.string(),
    sign: z.string(),
    degree: z.number(),
    position: z.number()
  }))
});

const ProfileSchema = z.object({
  userId: z.string(),
  birthData: z.object({ date: z.string(), time: z.string(), location: z.string() }),
});

const NumerologySchema = z.object({
  lifePath: z.number(),
  destiny: z.number(),
  personalYear: z.number(),
});

// Inferred schema types to keep validatedData strongly typed and avoid unsafe any
type ChartDataValidated = z.infer<typeof ChartSchema>;
type ProfileDataValidated = z.infer<typeof ProfileSchema>;
type NumerologyDataValidated = z.infer<typeof NumerologySchema>;

// Safe replacer: ensure undefined removed, typed with unknown to avoid unsafe any returns
const removeUndefinedReplacer = (_key: string, value: unknown): unknown => (
  value === undefined ? null : value
);

// Serialization function
export function serializeAstrologyData(data: AstrologyChart | UserProfile | NumerologyData): string {
  try {
    let validatedData: ChartDataValidated | ProfileDataValidated | NumerologyDataValidated;

    // Use type guards for more precise type narrowing
    if (isAstrologyChart(data)) {
      validatedData = ChartSchema.parse(data);
    } else if (isUserProfile(data)) {
      validatedData = ProfileSchema.parse(data);
    } else if (isNumerologyData(data)) {
      validatedData = NumerologySchema.parse(data);
    } else {
      throw new Error('Unknown data type for serialization');
    }

    // Optimize JSON size by removing undefined fields
    return JSON.stringify(validatedData, removeUndefinedReplacer);
  } catch (error) {
    // Swallow internal error details to avoid leaking structure; rethrow generic
    throw new Error('Failed to serialize data');
  }
}

// Deserialization function
export function deserializeAstrologyData<T extends AstrologyChart | UserProfile | NumerologyData>(json: string): T {
  try {
    const parsedUnknown: unknown = JSON.parse(json);

    // Use type guards for more precise type detection and validation
    if (isAstrologyChart(parsedUnknown)) {
      return ChartSchema.parse(parsedUnknown) as T;
    } 

    if (isUserProfile(parsedUnknown)) {
      return ProfileSchema.parse(parsedUnknown) as T;
    }

    if (isNumerologyData(parsedUnknown)) {
      return NumerologySchema.parse(parsedUnknown) as T;
    }

    // Use getAstrologyDataType for more detailed error message
    const dataType = getAstrologyDataType(parsedUnknown);
    throw new Error(`Unknown or invalid data type for deserialization: ${dataType}`);
  } catch (error) {
    if (error instanceof Error) {
  // Preserve error context for debugging while keeping public message generic.
  // Use global devConsole if present to avoid raw console.* usage (silences no-console warnings).
  // eslint-disable-next-line @typescript-eslint/no-explicit-any
  (globalThis as any)?.devConsole?.error?.('Deserialization error:', error.message);
    }
    throw new Error('Failed to deserialize data');
  }
}

/**
 * Shared foundational utility types for cross-package use.
 * Centralizing these avoids re-defining loose "Record<string, any>" patterns
 * and encourages explicit unknown usage + gradual refinement.
 */

// JSON primitives and structured values
export type JSONPrimitive = string | number | boolean | null;
export type JSONValue = JSONPrimitive | JSONObject | JSONArray;
export interface JSONObject { [key: string]: JSONValue; }
export interface JSONArray extends Array<JSONValue> {}

// Narrow record types
export type UnknownRecord = Record<string, unknown>;
export type StringMap<T = unknown> = Record<string, T>;

// Deep partial helper
export type DeepPartial<T> = {
  [K in keyof T]?: T[K] extends object ? DeepPartial<T[K]> : T[K];
};

// Brand utility (nominal typing)
export type Brand<T, B extends string> = T & { readonly __brand: B };

// Result discriminated unions
export interface Ok<T> { ok: true; value: T }
export interface Err<E = Error> { ok: false; error: E }
export type Result<T, E = Error> = Ok<T> | Err<E>;

// Function helpers
export type AsyncFn<TArgs extends unknown[] = unknown[], TReturn = unknown> = (...args: TArgs) => Promise<TReturn>;

// Predicate type
export type Predicate<T> = (value: unknown) => value is T;

// Exhaustive check helper
export function assertNever(x: never, message = 'Unexpected object'): never {
  throw new Error(`${message}: ${String(x)}`);
}

import React, { useState, useRef, useEffect, useId } from 'react';

export interface DropdownOption {
  value: string;
  label: string;
  disabled?: boolean;
}

export interface DropdownProps {
  options: DropdownOption[];
  value?: string;
  placeholder?: string;
  label?: string; // Accessible label (falls back to placeholder)
  onChange?: (value: string) => void;
  disabled?: boolean;
  className?: string;
}

export const Dropdown: React.FC<DropdownProps> = ({
  options,
  value,
  placeholder = 'Select an option',
  label,
  onChange,
  disabled = false,
  className = ''
}) => {
  const reactId = useId();
  const labelId = `${reactId}-label`;
  const listboxId = `${reactId}-listbox`;
  const [isOpen, setIsOpen] = useState(false);
  const [selectedValue, setSelectedValue] = useState(value || '');
  const dropdownRef = useRef<HTMLDivElement>(null);

  const selectedOption = options.find(option => option.value === selectedValue);

  useEffect(() => {
    const handleClickOutside = (event: MouseEvent) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target as Node)) {
        setIsOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, []);

  const handleSelect = (optionValue: string) => {
    setSelectedValue(optionValue);
    setIsOpen(false);
    onChange?.(optionValue);
  };

  const handleKeyDown = (event: React.KeyboardEvent) => {
    if (event.key === 'Enter' || event.key === ' ') {
      event.preventDefault();
      setIsOpen(!isOpen);
    } else if (event.key === 'Escape') {
      setIsOpen(false);
    }
  };

  return (
    <div ref={dropdownRef} className={`relative inline-block w-full ${className}`}>
      {/* Accessible label (visually hidden if not explicitly provided) */}
      <span id={labelId} className="sr-only">
        {label || placeholder}
      </span>
      {isOpen ? (
        <button
          type="button"
          className={`
            w-full px-4 py-2 text-left bg-white border border-gray-300 rounded-md shadow-sm
            focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500
            ${disabled ? 'bg-gray-100 cursor-not-allowed' : 'hover:border-gray-400 cursor-pointer'}
            ring-2 ring-blue-500 border-blue-500
          `}
          onClick={() => !disabled && setIsOpen(!isOpen)}
          onKeyDown={handleKeyDown}
          disabled={disabled}
          aria-haspopup="listbox"
          aria-expanded="true"
          aria-labelledby={labelId}
          aria-controls={listboxId}
          {...(disabled ? { 'aria-disabled': 'true' } : {})}
        >
          <span className={selectedOption ? 'text-gray-900' : 'text-gray-500'}>
            {selectedOption ? selectedOption.label : placeholder}
          </span>
          <span className="absolute inset-y-0 right-0 flex items-center pr-2 pointer-events-none">
            <svg className="w-5 h-5 text-gray-400" viewBox="0 0 20 20" fill="currentColor">
              <path fillRule="evenodd" d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z" clipRule="evenodd" />
            </svg>
          </span>
        </button>
      ) : (
        <button
          type="button"
          className={`
            w-full px-4 py-2 text-left bg-white border border-gray-300 rounded-md shadow-sm
            focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500
            ${disabled ? 'bg-gray-100 cursor-not-allowed' : 'hover:border-gray-400 cursor-pointer'}
          `}
          onClick={() => !disabled && setIsOpen(!isOpen)}
          onKeyDown={handleKeyDown}
          disabled={disabled}
          aria-haspopup="listbox"
          aria-expanded="false"
          aria-labelledby={labelId}
          aria-controls={listboxId}
          {...(disabled ? { 'aria-disabled': 'true' } : {})}
        >
          <span className={selectedOption ? 'text-gray-900' : 'text-gray-500'}>
            {selectedOption ? selectedOption.label : placeholder}
          </span>
          <span className="absolute inset-y-0 right-0 flex items-center pr-2 pointer-events-none">
            <svg className="w-5 h-5 text-gray-400" viewBox="0 0 20 20" fill="currentColor">
              <path fillRule="evenodd" d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z" clipRule="evenodd" />
            </svg>
          </span>
        </button>
      )}

      {isOpen && (
        <div className="absolute z-10 w-full mt-1 bg-white border border-gray-300 rounded-md shadow-lg">
          <ul
            role="listbox"
            id={listboxId}
            className="py-1 overflow-auto max-h-60"
            aria-labelledby={labelId}
            aria-label="Dropdown options"
          >
            {options.map((option) => {
              const selected = selectedOption?.value === option.value;
              const disabledOpt = option.disabled;
              return selected ? (
                <li
                  key={option.value}
                  id={`${listboxId}-opt-${option.value}`}
                  role="option"
                  aria-selected="true"
                  {...(disabledOpt ? { 'aria-disabled': 'true' } : {})}
                  className={`px-4 py-2 text-sm transition-colors ${
                    disabledOpt
                      ? 'text-gray-400 cursor-not-allowed'
                      : 'cursor-pointer bg-blue-100 text-blue-900'
                  }`}
                  onClick={() => !disabledOpt && handleSelect(option.value)}
                >
                  {option.label}
                </li>
              ) : (
                <li
                  key={option.value}
                  id={`${listboxId}-opt-${option.value}`}
                  role="option"
                  aria-selected="false"
                  {...(disabledOpt ? { 'aria-disabled': 'true' } : {})}
                  className={`px-4 py-2 text-sm transition-colors ${
                    disabledOpt
                      ? 'text-gray-400 cursor-not-allowed'
                      : 'cursor-pointer text-gray-700 hover:bg-gray-100'
                  }`}
                  onClick={() => !disabledOpt && handleSelect(option.value)}
                  onKeyDown={(e) => {
                    if (e.key === 'Enter' || e.key === ' ') {
                      e.preventDefault();
                      !disabledOpt && handleSelect(option.value);
                    }
                  }}
                >
                  {option.label}
                </li>
              );
            })}
          </ul>
        </div>
      )}
    </div>
  );
};

import React, { ReactNode } from 'react';
import ErrorBoundary from './ErrorBoundary';
import { ErrorContext } from '../hooks/useErrorHandling';

/**
 * Page-level error boundary for critical application errors
 */
interface PageErrorBoundaryProps {
  children: ReactNode;
  pageName?: string;
  onError?: (error: Error, errorInfo: any) => void;
}

export function PageErrorBoundary({ 
  children, 
  pageName,
  onError 
}: PageErrorBoundaryProps) {
  return (
    <ErrorBoundary
      level="page"
      name={pageName}
      onError={onError}
      resetOnPropsChange={true}
    >
      {children}
    </ErrorBoundary>
  );
}

/**
 * Section-level error boundary for isolated component groups
 */
interface SectionErrorBoundaryProps {
  children: ReactNode;
  sectionName?: string;
  fallback?: ReactNode;
  onError?: (error: Error, errorInfo: any) => void;
}

export function SectionErrorBoundary({ 
  children, 
  sectionName,
  fallback,
  onError 
}: SectionErrorBoundaryProps) {
  return (
    <ErrorBoundary
      level="section"
      name={sectionName}
      fallback={fallback}
      onError={onError}
    >
      {children}
    </ErrorBoundary>
  );
}

/**
 * Component-level error boundary for individual components
 */
interface ComponentErrorBoundaryProps {
  children: ReactNode;
  componentName?: string;
  fallback?: ReactNode | ((error: Error, errorInfo: any, retry: () => void) => ReactNode);
  onError?: (error: Error, errorInfo: any) => void;
  resetKeys?: Array<string | number>;
}

export function ComponentErrorBoundary({ 
  children, 
  componentName,
  fallback,
  onError,
  resetKeys 
}: ComponentErrorBoundaryProps) {
  return (
    <ErrorBoundary
      level="component"
      name={componentName}
      fallback={fallback}
      onError={onError}
      resetKeys={resetKeys}
    >
      {children}
    </ErrorBoundary>
  );
}

/**
 * Async operation error boundary with loading states
 */
interface AsyncErrorBoundaryProps {
  children: ReactNode;
  operationName?: string;
  loadingFallback?: ReactNode;
  errorFallback?: ReactNode;
  onError?: (error: Error, errorInfo: any) => void;
}

export function AsyncErrorBoundary({
  children,
  operationName,
  loadingFallback,
  errorFallback,
  onError
}: AsyncErrorBoundaryProps) {
  const asyncFallback = errorFallback || (
    <div className="p-4 bg-cosmic-dark/50 rounded-lg border border-cosmic-silver/20 text-center">
      <div className="text-amber-400 mb-2"></div>
      <p className="text-cosmic-silver text-sm">
        Failed to load {operationName || 'content'}
      </p>
      <button 
        onClick={() => window.location.reload()}
        className="mt-2 px-3 py-1 bg-cosmic-purple text-white text-sm rounded hover:bg-cosmic-purple/80"
      >
        Retry
      </button>
    </div>
  );

  return (
    <ErrorBoundary
      level="component"
      name={`async-${operationName}`}
      fallback={asyncFallback}
      onError={onError}
    >
      {children}
    </ErrorBoundary>
  );
}

/**
