import React, { useMemo } from 'react'

/**
 * Simple A/B Testing Hook
 * 
 * This is a basic implementation for A/B testing. For production use,
 * consider integrating with Split.io (@splitsoftware/splitio-react) for
 * more advanced features like:
 * - Server-side feature flags
 * - Real-time configuration updates  
 * - Advanced targeting and segmentation
 * - Detailed analytics and reporting
 * 
 * To upgrade to Split.io:
 * 1. npm install @splitsoftware/splitio-react
 * 2. Replace this hook with useSplitClient and useTreatments
 * 3. Configure Split.io dashboard for feature flags
 */

export interface ABTestConfig {
  testName: string
  variants: string[]
  weights?: number[] // Optional weights for each variant (defaults to equal distribution)
  enabled?: boolean // Feature flag to enable/disable test
}

export interface ABTestEventProperties {
  // Flexible but typed as unknown to encourage validation upstream
  [key: string]: string | number | boolean | null | undefined;
}

export interface ABTestResult {
  variant: string;
  isControl: boolean;
  trackEvent: (eventName: string, properties?: ABTestEventProperties) => void;
}

/**
 * Hook for simple A/B testing with localStorage persistence
 */
export function useABTest(config: ABTestConfig): ABTestResult {
  const { testName, variants, weights = [], enabled = true } = config

  const result = useMemo(() => {
    if (!enabled || variants.length === 0) {
      return {
        variant: variants[0] || 'control',
        isControl: true,
        trackEvent: () => {}
      }
    }

    // Check if user already has a variant assigned
    const storageKey = `ab_test_${testName}`
    const existingVariant = localStorage.getItem(storageKey)

    if (existingVariant && variants.includes(existingVariant)) {
      return {
        variant: existingVariant,
        isControl: existingVariant === variants[0],
        trackEvent: createEventTracker(testName, existingVariant)
      }
    }

    // Assign new variant based on weights or equal distribution
    let selectedVariant: string

    if (weights.length === variants.length) {
      // Use weighted distribution
      const totalWeight = weights.reduce((sum, weight) => sum + weight, 0)
      const random = Math.random() * totalWeight
      let cumulativeWeight = 0

      selectedVariant = variants[0] // fallback
      for (let i = 0; i < variants.length; i++) {
        cumulativeWeight += weights[i]
        if (random <= cumulativeWeight) {
          selectedVariant = variants[i]
          break
        }
      }
    } else {
      // Equal distribution
      const randomIndex = Math.floor(Math.random() * variants.length)
      selectedVariant = variants[randomIndex]
    }

    // Store the assignment
    localStorage.setItem(storageKey, selectedVariant)

    return {
      variant: selectedVariant,
      isControl: selectedVariant === variants[0],
      trackEvent: createEventTracker(testName, selectedVariant)
    }
  }, [testName, variants, weights, enabled])

  return result
}

/**
 * Create an event tracker for A/B test analytics
 */
function createEventTracker(testName: string, variant: string) {
  return (eventName: string, properties: ABTestEventProperties = {}) => {
    // Store event in local analytics
    const events: Array<Record<string, unknown>> = JSON.parse(localStorage.getItem('ab_test_events') || '[]')
    events.push({
      testName,
      variant,
      event: eventName,
      timestamp: new Date().toISOString(),
      ...properties
    })
    localStorage.setItem('ab_test_events', JSON.stringify(events.slice(-100))) // Keep last 100 events

    // Send to analytics services
    try {
      // Google Analytics (gtag)
      if (typeof window !== 'undefined' && (window as any).gtag) {
        (window as any).gtag('event', eventName, {
          custom_parameter_ab_test: `${testName}_${variant}`,
          test_name: testName,
          variant: variant,
          ...properties
        });
      }

      // Mixpanel
      if (typeof window !== 'undefined' && (window as any).mixpanel) {
        (window as any).mixpanel.track(eventName, {
          ab_test: testName,
          variant: variant,
          ...properties
        });
      }

      // PostHog
      if (typeof window !== 'undefined' && (window as any).posthog) {
        (window as any).posthog.capture(eventName, {
          $set: { ab_test_group: variant },
          ab_test_name: testName,
          ...properties
        });
      }

      // Firebase Analytics (lazy loaded for production)
      if (typeof window !== 'undefined' && import.meta.env.PROD) {
        import('firebase/analytics').then(({ getAnalytics, logEvent }) => {
          import('@cosmichub/config/firebase').then(({ app }) => {
            const analytics = getAnalytics(app);
            logEvent(analytics, eventName, {
              ab_test_name: testName,
              ab_test_variant: variant,
              ...properties
            });
          }).catch(() => {
            // Firebase not available, skip silently
          });
        }).catch(() => {
          // Firebase Analytics not available, skip silently
        });
      }

    } catch (error) {
      if (import.meta.env.DEV) {
        // eslint-disable-next-line no-console
        console.warn('Failed to send A/B test analytics:', error);
      }
    }

    // Development logging
    if (import.meta.env.DEV) {
      // eslint-disable-next-line no-console
      console.log('[A/B Test Event]', {
        test: testName,
        variant,
        event: eventName,
        timestamp: new Date().toISOString(),
        ...properties
      });
    }
  }
}

/**
 * React component wrapper for A/B testing
 */
export interface ABTestProps {
  config: ABTestConfig
  children: (result: ABTestResult) => React.ReactNode
}

export function ABTest({ config, children }: ABTestProps) {
  const result = useABTest(config)
  return children(result) as JSX.Element
}

export default useABTest

import { useCallback, useRef, useState } from 'react';

export interface AsyncError {
  error: Error;
  retry: () => void;
  reset: () => void;
}

export interface UseAsyncErrorOptions {
  onError?: (error: Error) => void;
  maxRetries?: number;
  retryDelay?: number;
}

/**
 * Hook for handling async errors with retry logic
 */
export function useAsyncError(options: UseAsyncErrorOptions = {}) {
  const { onError, maxRetries = 3, retryDelay = 1000 } = options;
  const [error, setError] = useState<Error | null>(null);
  const [retryCount, setRetryCount] = useState(0);
  const retryTimeoutRef = useRef<number>();

  const handleError = useCallback((error: Error) => {
    setError(error);
    onError?.(error);
  }, [onError]);

  const retry = useCallback(() => {
    if (retryCount < maxRetries) {
      setRetryCount(prev => prev + 1);
      setError(null);

      // Exponential backoff delay
      const delay = retryDelay * Math.pow(2, retryCount);

      if (retryTimeoutRef.current) {
        clearTimeout(retryTimeoutRef.current);
      }

      retryTimeoutRef.current = window.setTimeout(() => {
        // The actual retry logic would be implemented by the consumer
      }, delay);
    }
  }, [retryCount, maxRetries, retryDelay]);

  const reset = useCallback(() => {
    setError(null);
    setRetryCount(0);
    if (retryTimeoutRef.current) {
      clearTimeout(retryTimeoutRef.current);
    }
  }, []);

  const canRetry = retryCount < maxRetries;

  return {
    error,
    retry,
    reset,
    handleError,
    canRetry,
    retryCount,
  };
}

/**
 * Hook for safe async operations with error handling
 */
export interface SafeAsyncState<T> {
  data: T | null;
  loading: boolean;
  error: Error | null;
}

export interface UseSafeAsyncReturn<T> extends SafeAsyncState<T> {
  execute: (asyncFunction: () => Promise<T>) => Promise<T>;
  reset: () => void;
}

// Default generic is unknown to force consumers to specify or consciously narrow later
export function useSafeAsync<T = unknown>(): UseSafeAsyncReturn<T> {
  const [state, setState] = useState<{
    data: T | null;
    loading: boolean;
    error: Error | null;
  }>({
    data: null,
    loading: false,
    error: null,
  });

  const execute = useCallback(async (asyncFunction: () => Promise<T>) => {
    setState(prev => ({ ...prev, loading: true, error: null }));

    try {
      const data = await asyncFunction();
      setState({ data, loading: false, error: null });
      return data;
    } catch (error) {
      const err = error instanceof Error ? error : new Error(String(error));
      setState(prev => ({ ...prev, loading: false, error: err }));
      throw err;
    }
  }, []);

  const reset = useCallback(() => {
    setState({ data: null, loading: false, error: null });
  }, []);

  return { ...state, execute, reset };
}

/**
 * Utility for handling form errors
 */
export interface FormError {
  field?: string;
  message: string;
  code?: string;
}

export function useFormErrors() {
  const [errors, setErrors] = useState<FormError[]>([]);

  const addError = useCallback((error: FormError) => {
    setErrors(prev => [...prev, error]);
  }, []);

  const addErrors = useCallback((newErrors: FormError[]) => {
    setErrors(prev => [...prev, ...newErrors]);
  }, []);

  const removeError = useCallback((field?: string) => {
    if (field) {
      setErrors(prev => prev.filter(err => err.field !== field));
    } else {
      setErrors([]);
    }
  }, []);

  const clearErrors = useCallback(() => {
    setErrors([]);
  }, []);

  const getFieldError = useCallback((field: string) => {
    return errors.find(err => err.field === field);
  }, [errors]);

  const hasErrors = errors.length > 0;
  const hasFieldError = useCallback((field: string) => {
    return errors.some(err => err.field === field);
  }, [errors]);

  return {
    errors,
    addError,
    addErrors,
    removeError,
    clearErrors,
    getFieldError,
    hasErrors,
    hasFieldError,
  };
}

/**
 * Enhanced error context for logging and reporting
 */
export interface ErrorContext {
  userId?: string;
  sessionId?: string;
  feature?: string;
  action?: string;
  metadata?: Record<string, any>;
}

export function createEnhancedError(
  message: string,
  context?: ErrorContext,
  originalError?: Error
): Error {
  const error = new Error(message);

  // Add context to error object
  if (context) {
    Object.assign(error, { context });
  }

  // Chain original error
  if (originalError) {
    Object.assign(error, { cause: originalError });
  }

  // Add stack trace from original error if available
  if (originalError && originalError.stack) {
    error.stack = `${error.stack}\nCaused by: ${originalError.stack}`;
  }

  return error;
}

/**
 * Error classification utilities
 */
export enum ErrorType {
  NETWORK = 'network',
  VALIDATION = 'validation',
  AUTHENTICATION = 'authentication',
  AUTHORIZATION = 'authorization',
  NOT_FOUND = 'not_found',
  SERVER = 'server',
  CLIENT = 'client',
  UNKNOWN = 'unknown',
}

export function classifyError(error: Error): ErrorType {
  const message = error.message.toLowerCase();
  const stack = error.stack?.toLowerCase() || '';

  if (message.includes('network') || message.includes('fetch') || message.includes('timeout')) {
    return ErrorType.NETWORK;
  }

  if (message.includes('validation') || message.includes('invalid')) {
    return ErrorType.VALIDATION;
  }

  if (message.includes('unauthorized') || message.includes('authentication')) {
    return ErrorType.AUTHENTICATION;
  }

  if (message.includes('forbidden') || message.includes('permission')) {
    return ErrorType.AUTHORIZATION;
  }

  if (message.includes('not found') || message.includes('404')) {
    return ErrorType.NOT_FOUND;
  }

  if (message.includes('server') || message.includes('500') || message.includes('503')) {
    return ErrorType.SERVER;
  }

  if (stack.includes('render') || stack.includes('component')) {
    return ErrorType.CLIENT;
  }

  return ErrorType.UNKNOWN;
}

/**
 * Error retry strategies
 */
export interface RetryConfig {
  maxAttempts: number;
  baseDelay: number;
  maxDelay: number;
  backoffFactor: number;
  retryableErrors: ErrorType[];
}

export const defaultRetryConfig: RetryConfig = {
  maxAttempts: 3,
  baseDelay: 1000,
  maxDelay: 10000,
  backoffFactor: 2,
  retryableErrors: [ErrorType.NETWORK, ErrorType.SERVER],
};

export function shouldRetry(error: Error, config: RetryConfig = defaultRetryConfig): boolean {
  const errorType = classifyError(error);
  return config.retryableErrors.includes(errorType);
}

export function calculateDelay(
  attempt: number,
  config: RetryConfig = defaultRetryConfig
): number {
  const delay = config.baseDelay * Math.pow(config.backoffFactor, attempt - 1);
  return Math.min(delay, config.maxDelay);
}

/**
 * Error recovery strategies
 */
export interface RecoveryAction {
  label: string;
  action: () => void;
  primary?: boolean;
}

export function getRecoveryActions(
  error: Error,
  context: ErrorContext = {}
): RecoveryAction[] {
  const errorType = classifyError(error);
  const actions: RecoveryAction[] = [];

  switch (errorType) {
    case ErrorType.NETWORK:
      actions.push({
        label: 'Try Again',
        action: () => window.location.reload(),
        primary: true,
      });
      actions.push({
        label: 'Check Connection',
        action: () => {
          // Open network diagnostics or show connection status
        },
      });
      break;

    case ErrorType.AUTHENTICATION:
      actions.push({
        label: 'Sign In',
        action: () => window.location.href = '/login',
        primary: true,
      });
      break;

    case ErrorType.AUTHORIZATION:
      actions.push({
        label: 'Go Back',
        action: () => window.history.back(),
        primary: true,
      });
      break;

    case ErrorType.NOT_FOUND:
      actions.push({
        label: 'Go Home',
        action: () => window.location.href = '/',
        primary: true,
      });
      break;

    default:
      actions.push({
        label: 'Try Again',
        action: () => window.location.reload(),
        primary: true,
      });
      actions.push({
        label: 'Go Back',
        action: () => window.history.back(),
      });
  }

  return actions;
}
